INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES ("今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 0, 8, 40001, 37, 1, 1, 150, 107501, "ぺコリーヌ", 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES ("この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 0, 8, 40001, 38, 2, 1, 150, 107601, "コッコロ", 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES ("あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 0, 8, 40001, 39, 3, 1, 150, 107801, "キャル", 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES ("あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 0, 8, 40001, 40, 4, 1, 150, 107701, "スズメ", 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES ("今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 0, 8, 40001, 41, 5, 1, 150, 107901, "タマキ", 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES ("う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 0, 8, 40001, 42, 6, 2, 150, 107501, "ぺコリーヌ", 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES ("夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 0, 8, 40001, 43, 7, 2, 150, 107601, "コッコロ", 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES ("ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 0, 8, 40001, 44, 8, 2, 150, 107801, "キャル", 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES ("あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 0, 8, 40001, 45, 9, 2, 150, 107701, "スズメ", 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES ("夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 0, 8, 40001, 46, 10, 2, 150, 107901, "タマキ", 91002);
